INSERT INTO `wp_posts` VALUES (1957,1,'2021-03-31 05:21:41','2021-03-31 05:21:41','[fusion_builder_container hundred_percent=\"no\" equal_height_columns=\"no\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" background_position=\"center center\" background_repeat=\"no-repeat\" fade=\"no\" background_parallax=\"none\" parallax_speed=\"0.3\" video_aspect_ratio=\"16:9\" video_loop=\"yes\" video_mute=\"yes\" border_style=\"solid\" type=\"flex\" padding_top=\"2vw\" padding_bottom=\"7vw\" flex_align_items=\"flex-start\" padding_top_small=\"0px\" padding_right_small=\"12vw\" padding_bottom_small=\"12vw\" padding_left_small=\"12vw\" animation_type=\"fade\" animation_direction=\"up\" animation_speed=\"1.2\" admin_toggled=\"no\" admin_label=\"About - Info\"][fusion_builder_row][fusion_builder_column type=\"1_3\" layout=\"1_3\" background_position=\"left top\" background_color=\"\" border_color=\"\" border_style=\"solid\" border_position=\"all\" spacing=\"yes\" background_image=\"\" background_repeat=\"no-repeat\" padding_top=\"\" padding_right=\"\" padding_bottom=\"\" padding_left=\"\" margin_top=\"0px\" margin_bottom=\"0px\" class=\"\" id=\"\" animation_type=\"\" animation_speed=\"0.3\" animation_direction=\"left\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" center_content=\"no\" last=\"false\" min_height=\"\" hover_type=\"none\" link=\"\" first=\"true\" spacing_right=\"2%\"][fusion_title title_type=\"text\" rotation_effect=\"bounceIn\" display_time=\"1200\" highlight_effect=\"circle\" loop_animation=\"off\" highlight_width=\"9\" highlight_top_margin=\"0\" before_text=\"\" rotation_text=\"\" highlight_text=\"\" after_text=\"\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" sticky_display=\"normal,sticky\" class=\"\" id=\"\" content_align_medium=\"\" content_align_small=\"\" content_align=\"left\" size=\"2\" font_size=\"\" animated_font_size=\"\" fusion_font_family_title_font=\"\" fusion_font_variant_title_font=\"\" line_height=\"1.3em\" letter_spacing=\"\" text_shadow=\"no\" text_shadow_vertical=\"\" text_shadow_horizontal=\"\" text_shadow_blur=\"0\" text_shadow_color=\"\" margin_top_medium=\"\" margin_bottom_medium=\"\" margin_top_small=\"\" margin_bottom_small=\"\" margin_top=\"\" margin_bottom=\"\" margin_top_mobile=\"\" margin_bottom_mobile=\"\" text_color=\"\" animated_text_color=\"\" highlight_color=\"\" style_type=\"default\" sep_color=\"\" animation_type=\"\" animation_direction=\"left\" animation_speed=\"0.3\" animation_offset=\"\"]\r\n\r\nParks Victoria manages a diverse network of parks that are home to over 4,300 native plant species and 948 native animal species. These parks include some of Victoria’s largest and most undisturbed ecosystems - landscapes like the Alps, the mallee, grasslands and inland waters and wetlands.\r\n\r\n[/fusion_title][/fusion_builder_column][fusion_builder_column type=\"1_3\" layout=\"1_3\" background_position=\"left top\" background_color=\"\" border_color=\"\" border_style=\"solid\" border_position=\"all\" spacing=\"yes\" background_image=\"\" background_repeat=\"no-repeat\" padding_top=\"10px\" padding_right=\"\" padding_bottom=\"\" padding_left=\"\" margin_top=\"0px\" margin_bottom=\"0px\" class=\"\" id=\"\" animation_type=\"\" animation_speed=\"0.3\" animation_direction=\"left\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" center_content=\"no\" last=\"false\" min_height=\"\" hover_type=\"none\" link=\"\" first=\"false\" spacing_right=\"2%\" spacing_left=\"2%\"][fusion_text columns=\"\" column_min_width=\"\" column_spacing=\"\" rule_style=\"default\" rule_size=\"\" rule_color=\"\" content_alignment_medium=\"\" content_alignment_small=\"\" content_alignment=\"\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" sticky_display=\"normal,sticky\" class=\"\" id=\"\" font_size=\"\" fusion_font_family_text_font=\"\" fusion_font_variant_text_font=\"\" line_height=\"\" letter_spacing=\"\" text_color=\"\" animation_type=\"\" animation_direction=\"left\" animation_speed=\"0.3\" animation_offset=\"\"]\r\n\r\nHome to dozens of national parks, there are plenty of opportunities to reconnect with nature across Victoria. From breath-taking coastal spots through to vibrant sand dunes and ethereal rainforests, there are all manner of landscapes to discover.\r\n\r\n[/fusion_text][/fusion_builder_column][fusion_builder_column type=\"1_3\" layout=\"1_3\" background_position=\"left top\" background_color=\"\" border_color=\"\" border_style=\"solid\" border_position=\"all\" spacing=\"yes\" background_image=\"\" background_repeat=\"no-repeat\" padding_top=\"10px\" padding_right=\"\" padding_bottom=\"\" padding_left=\"\" margin_top=\"0px\" margin_bottom=\"0px\" class=\"\" id=\"\" animation_type=\"\" animation_speed=\"0.3\" animation_direction=\"left\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" center_content=\"no\" last=\"true\" min_height=\"\" hover_type=\"none\" link=\"\" first=\"false\" spacing_left=\"2%\"][fusion_text columns=\"\" column_min_width=\"\" column_spacing=\"\" rule_style=\"default\" rule_size=\"\" rule_color=\"\" content_alignment_medium=\"\" content_alignment_small=\"\" content_alignment=\"\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" sticky_display=\"normal,sticky\" class=\"\" id=\"\" font_size=\"\" fusion_font_family_text_font=\"\" fusion_font_variant_text_font=\"\" line_height=\"\" letter_spacing=\"\" text_color=\"\" animation_type=\"\" animation_direction=\"left\" animation_speed=\"0.3\" animation_offset=\"\"]\r\n\r\nHead off on an out-of-town adventure in Victoria\'s renowned national parks and reserves. With more than 100 to choose from, it\'s not difficult to find that perfect bush getaway destination\r\n\r\n[/fusion_text][/fusion_builder_column][/fusion_builder_row][/fusion_builder_container][fusion_builder_container type=\"flex\" hundred_percent=\"no\" hundred_percent_height=\"no