um=\"\" margin_bottom_medium=\"\" margin_top_small=\"\" margin_bottom_small=\"\" margin_top=\"\" margin_bottom=\"\" margin_top_mobile=\"\" margin_bottom_mobile=\"\" text_color=\"\" animated_text_color=\"\" highlight_color=\"\" style_type=\"default\" sep_color=\"\" animation_type=\"\" animation_direction=\"left\" animation_speed=\"0.3\" animation_offset=\"\"]\r\n\r\nParks Victoria manages a diverse network of parks that are home to over 4,300 native plant species and 948 native animal species.\r\n\r\n[/fusion_title][/fusion_builder_column][fusion_builder_column type=\"1_3\" layout=\"1_3\" background_position=\"left top\" background_color=\"\" border_color=\"\" border_style=\"solid\" border_position=\"all\" spacing=\"yes\" background_image=\"\" background_repeat=\"no-repeat\" padding_top=\"10px\" padding_right=\"\" padding_bottom=\"\" padding_left=\"\" margin_top=\"0px\" margin_bottom=\"0px\" class=\"\" id=\"\" animation_type=\"\" animation_speed=\"0.3\" animation_direction=\"left\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" center_content=\"no\" last=\"false\" min_height=\"\" hover_type=\"none\" link=\"\" first=\"false\" spacing_right=\"2%\" spacing_left=\"2%\"][fusion_text columns=\"\" column_min_width=\"\" column_spacing=\"\" rule_style=\"default\" rule_size=\"\" rule_color=\"\" content_alignment_medium=\"\" content_alignment_small=\"\" content_alignment=\"\" hide_on_mobile=\"small-visibility,medium-visibility,large-visibility\" sticky_display=\"normal,sticky\" class=\"\" id=\"\" font_size=\"\" fusion_font_family_text_font=\"\" fusion_font_variant_text_font=\"\" line_height=\"\" letter_spacing=\"\" text_color=\"\" animation_type=\"\" animation_direction=\"left\" animation_speed=\"0.3\" animation_offset=\"\"]\r\n\r\nHome to dozens of national parks, there are plenty of opportunities to reconnect with nature across Victoria. From breath-taking coastal spots through to vibrant sand dunes and ethereal rainforests, there are all manner of lan